	('22857235631059747', '{"ueq enjoyable":"5","ueq understandable":"5","ueq dull":"3","ueq difficult to learn":"3","ueq inferior":"3","ueq exciting":"4","ueq interesting":"4","ueq predictable":"3","ueq slow":"2","ueq conventional":"3","ueq supportive":"4","ueq bad":"3","ueq easy":"3","ueq pleasing":"4","ueq leading edge":"4","ueq pleasant":"4","ueq not secure":"3","ueq demotivating":"2","ueq does not meet expectations":"4","ueq efficient":"5","ueq confusing":"3","ueq practical":"5","ueq cluttered":"3","ueq unattractive":"3","ueq unfriendly":"3","ueq innovative":"4","text amount":"2","text size":"2","gamer":"2","reason stopping":"all texts read","other reason stopping":"","additional comments":"Hoop dat je er wat aan hebt, heel veel succues!\\r\\nIk vond de introteksten enzo wel veel/lang, terwijl het voor een beetje pc gebruiker echt niet moeiljk is te bedienen. Vond de shortcuts heel prettig. Weet niet of ik te snel sprak soms. Soms is de tekst vreemd omdat je context mist en dan weet je eigenlijk niet wat je zegt / waar je naartoe wilt qua verhaal. Sommige teksten zijn te kort en sommige medische teksten zijn kapot moeilijk, haha, wel leuk.\\r\\nVan sommige dingen onduidelijk hoe ze uit te spreken (afkortingen als XXAIDS en ZOGH oid en ACETON alleen iets wat er op leek) dus ja."'),
